window.bookSummaryJSON = "<p><b>A deadly venom. A looming rebellion. A vicious siege. And the clock is ticking.</b></p> <p>For sorcerer Nate Garrett, the stakes have risen. If Asgard falls, he may lose much more than his home - he may lose the thing dearest to him. To stand a fighting chance against Avalon, he must be ready to go to war. But when his best friend and father are poisoned, Nate must race against the clock in a desperate quest to find a cure.</p> <p>Layla Cassidy is tasked with gaining the aid of the Valkyrie in Valhalla, but once there, she finds herself involved in another rebellion and must pick a side.</p> <p>Meanwhile, Mordred finds himself on a hunt for Excalibur, a weapon of incredible power that would aid the rebellion in their fight against Arthur and his allies. But to retrieve it, Mordred must face uncomfortable truths about himself.</p> <p>War looms over the rebellion, and the battle for Asgard is at hand. Time is running out as Avalon's forces threaten total destruction. But Nate can't be in two places at once. Can he find the cure, and can he, Layla, and Mordred save the realms before it’s too late?</p>"; 
